import React from 'react';

const NavBar = (props) => {
    return(
        <div>
            <ul>
                <li>NBA</li>
                <li>Soccer</li>
                <li>NFL</li>
                <li>MLB</li>
                <li>NHL</li>
            </ul>
        </div>
    )
}

export default NavBar;
